import { Button } from "@mui/material";
import React, { useEffect } from "react";
import styled from "styled-components";

//styled
const CommonTaskContainer = styled.div`
  & table {
    width: 100%;
    color: #555555;
    
    & th {
     
      font-size: 14px;
      text-align: left;
      padding: 10px;
      border-bottom: 2px solid #f3f3f3;
    }
    & td {
      margin: 10px;
      padding: 10px;
      border-bottom: 2px solid #f3f1f1;
     
    }
    
    & tr {
      background-color: #f6f6f6;
      border-bottom: 2px solid #f2f2f2;
      &:nth-child(even) {
        background: white;
      }
      &:hover{
        background:#f1f1f1;
      }
    }
  }
`;

const ActionBtn = styled.div`
  float:right;
`;

const CommonTask = () => {
 
  
  


  return (
    <CommonTaskContainer>
      <h5>Common Task (9) </h5>
      <p>These tasks are automatically added to all new projects</p>
      <table style={{width:"250%"}}>
        <thead>
          <tr>
            <th colSpan={3}>Name</th>
          </tr>
        </thead>

        <tbody>
          
          
              <tr >
                <td style={{width:"5%"}} >
                  {/* <EditTask value={item} /> */}
                  B
                  </td>
                  <td>
                
               
                    <ActionBtn>
                      <Button 
                     
                        variant="contained"
                        style={{ marginRight: "10px", background:'#FFFFFF', textTransform: 'none' }}
                      >
                        UnArchive
                      </Button>
                      <Button
                      variant="contained"
                        style={{ background:'#FFFFFF', textTransform: 'none' }}
                        // onClick={() => handleDelete(item.id)}
                      >
                        Delete
                      </Button>
                    </ActionBtn>
            
                </td>
              </tr>
           
        </tbody>
      </table>
    </CommonTaskContainer>
  );
};

export default CommonTask;

